import React from 'react';
import './login.css';

const Login = ({loginControll,handleChangeName,handleChangePassword,message})=>{
    return(
        <div className="login-container">
            <p>{message}</p>
            <form onSubmit={loginControll} >
                <input className="login-input" type="text" required placeholder="username ..." onChange={handleChangeName}/>
                <input className="login-input" type="text" required placeholder="password ..." onChange={handleChangePassword}/>
                <button className="login-btn">signin</button>
            </form>
        </div>
    );
}

export default Login;
